generated.css:
.presentation {
  display: flex;
  justify-content: center;
  align-items: center;

  padding-bottom: 40px;
  border-bottom: 1px solid rgb(6, 115, 154, 0.3);

  color: #fff;
}

.presentation_container {
  display: flex;
  flex-direction: column;
  justify-content: center;
  align-items: center;

  border-radius: 40px;
  width: 1860px;
  height: 685px;

  background-image: url(/5e0e4c53fa987397ed3aedc4c340b8d5.png);
}

.presentation_wrapper {
  width: 1720px;
  height: 525px;
}

.presentation_head {
  margin-bottom: 80px;
}

.presentation_head_remark {
  font-size: 40px;
  color: rgba(255, 255, 255, 0.6);
  margin: 0;
}

.presentation_head_title {
  font-size: 86px;
  letter-spacing: 0.01em;
  margin: 0;
}

.presentation_body {
  width: 700px;
}

.presentation_body_title {
  font-size: 46px;
}

.presentation_body_text {
  font-size: 17px;
  line-height: 1.2;
  color: rgba(255, 255, 255, 0.8);

  margin-bottom: 40px;
}

@media screen and (max-width: 1880px) {
  .presentation_container {
    width: 1600px;
  }

  .presentation_wrapper {
    width: 1500px;
  }
}

@media screen and (max-width: 1640px) {
  .presentation_container {
    width: 1400px;
  }

  .presentation_wrapper {
    width: 1300px;
  }
}

@media screen and (max-width: 1380px) {
  .presentation_container {
    width: 1100px;
  }

  .presentation_wrapper {
    width: 1000px;
  }
}

@media screen and (max-width: 1100px) {
  .presentation_container {
    width: 800px;
  }

  .presentation_head {
    margin-bottom: 50px;
  }

  .presentation_wrapper {
    width: 700px;
  }

  .presentation_head_title {
    font-size: 62px;
  }

  .presentation_body_title {
    font-size: 38px;
  }
}

@media screen and (max-width: 800px) {
  .presentation_container {
    width: 450px;
  }

  .presentation_head {
    margin-bottom: 30px;
  }

  .presentation_wrapper {
    width: 400px;
    height: 400px;
  }

  .presentation_head_title {
    font-size: 42px;
  }

  .presentation_body_title {
    font-size: 24px;
  }

  .presentation_body {
    width: 400px;
  }

  .presentation_container {
    height: 500px;
  }
}

.presentation_body_button {
  width: 472px;
  height: 50px;
  border-radius: 45px;
  background: #fff;
  border: none;
  cursor: pointer;
  color: #00719b;
  font-size: 20px;
}

@media screen and (max-width: 800px) {
  .presentation_body_button {
    width: 400px;
  }
}

/* serviceInfo */

.serviceInfo {
  color: #00719b;
  padding-bottom: 30px;
  border-bottom: 1px solid rgb(6, 115, 154, 0.3);
}

.serviceInfo_wrapper {
  display: flex;
  justify-content: space-between;
}

.serviceInfo_insideWrapper {
  display: flex;
  gap: 60px;
}

@media screen and (max-width: 1820px) {
  .serviceInfo_insideWrapper {
    gap: 10px;
  }
}

.serviceInfo__titleBlock {
  width: 455px;
}

.serviceInfo__titleBlock_title {
  margin: 0;
  margin-bottom: 32px;

  font-size: 30px;
  letter-spacing: -0.01em;
}

.serviceInfo__titleBlock_text {
  font-size: 17px;
  line-height: 1.2;

  margin-bottom: 116px;
}

@media screen and (max-width: 1790px) {
  .serviceInfo_wrapper {
    flex-direction: column;
  }

  .serviceInfo_insideWrapper {
    justify-content: space-between;
  }

  .serviceInfo__titleBlock {
    margin-bottom: 30px;
  }

  .serviceInfo__titleBlock_text {
    margin-bottom: 40px;
  }

  .serviceInfo__titleBlock_title {
    margin-bottom: 20px;
  }
}

@media screen and (max-width: 1320px) {
  .serviceInfo_insideWrapper {
    flex-direction: column;
  }
}

.serviceInfo__titleBlock_img {
  width: 433px;
  height: 433px;
}

.serviceInfo__information {
  width: 700px;
}

.serviceInfo__information_phBlock_text {
  font-size: 20px;
  font-style: italic;
  line-height: 1.2;
}

.serviceInfo__information_textBlock {
  font-size: 17px;
  line-height: 1.2;
  margin-bottom: 30px;
}

.serviceInfo__information_phBlock {
  display: flex;
  align-items: center;
  gap: 20px;

  border-bottom: 1px solid rgb(0, 113, 155, 0.45);
  padding-bottom: 10px;
  margin-bottom: 30px;
}

.serviceInfo__information_title {
  font-size: 30px;
  line-height: 1.2;
  letter-spacing: -0.01em;

  margin: 0;
  margin-bottom: 10px;
}

@media screen and (max-width: 750px) {
  .serviceInfo__information {
    width: 420px;
  }

  .serviceInfo_wrapper {
    align-items: center;
  }
}

.serviceInfo__information_cards {
  display: grid;
  grid-template-columns: 1fr 1fr;
  column-gap: 60px;
  row-gap: 20px;
}

.serviceInfo__information_cards_card {
  display: flex;
  align-items: center;
  gap: 20px;

  padding-bottom: 20px;
  border-bottom: 1px solid rgb(0, 113, 155, 0.45);
}

.serviceInfo__information_cards_card_text {
  margin: 0;
  font-size: 20px;
  font-weight: 300;
  line-height: 1.2;
}

.serviceInfo__historyBlock_text {
  width: 470px;
}

@media screen and (max-width: 750px) {
  .serviceInfo__historyBlock {
    width: 420px;
  }

  .serviceInfo__historyBlock_img {
    width: 420px;
  }

  .serviceInfo__historyBlock_text {
    width: 420px;
  }
}

/* historyBlock */

.historyBlock {
  display: flex;
  gap: 80px;

  color: #00719b;
}

.historyBlock__leftBlock {
  display: flex;
  flex-direction: column;
  justify-content: space-between;

  width: 880px;
  height: 1291px;
  margin-left: 60px;
}

@media screen and (max-width: 1480px) {
  .historyBlock {
    flex-direction: column;
    align-items: center;
  }

  .historyBlock__leftBlock {
    height: 700px;
    margin: 0;
  }
}

.historyBlock__leftBlock_title {
  margin: 0;
}

@media screen and (max-width: 1300px) {
  .historyBlock__leftBlock_title {
    font-size: 32px;
    width: 550px;
  }
}

@media screen and (max-width: 700px) {
  .historyBlock__leftBlock_title {
    font-size: 24px;
    width: 400px;
  }

  .historyBlock__leftBlock {
    height: 470px;
  }
}

.historyBlock__leftBlock_banner {
  display: flex;
  justify-content: center;
  align-items: center;

  width: 880px;
  height: 417px;
  border-radius: 40px;

  color: #fff;
  box-shadow: 0 0 15px 0 rgba(0, 113, 155, 0.07);
  background-color: #00719b;
}

.historyBlock__leftBlock_banner_wrapper {
  display: flex;
  flex-direction: column;
  justify-content: space-between;

  width: 760px;
  height: 297px;
}

.historyBlock__leftBlock_banner_text {
  font-size: 30px;
  line-height: 1.2;
}

.historyBlock__leftBlock_banner_button {
  border: none;
  border-radius: 45px;
  width: 300px;
  height: 50px;

  background: #fff;
  font-size: 20px;
  color: #00719b;
  cursor: pointer;
}
@media screen and (max-width: 980px) {
  .historyBlock__leftBlock {
    width: 400px;
  }

  .historyBlock__leftBlock_banner_wrapper {
    width: 360px;
    justify-content: center;
    align-items: center;
    height: 200px;
  }

  .historyBlock__leftBlock_banner {
    width: 400px;
    height: 250px;
  }

  .historyBlock__leftBlock_banner_text {
    font-size: 17px;
  }
}

.historyBlock__rightBlock_card {
  margin-bottom: 80px;
}

.historyBlock__rightBlock_card_head {
  display: flex;
  align-items: start;
  justify-content: space-between;
}

.historyBlock__rightBlock_card_head_title {
  font-size: 30px;
  line-height: 1.2;
  width: 400px;
}

.historyBlock__rightBlock_card_head_number {
  font-size: 30px;
  letter-spacing: -0.01em;
  color: #388fae;
  opacity: 0.3;
}

@media screen and (max-width: 1480px) {
  .historyBlock__rightBlock {
    width: 880px;
  }
}

@media screen and (max-width: 910px) {
  .historyBlock__rightBlock {
    width: 400px;
  }
}

.historyBlock__rightBlock_card_body {
  display: grid;
  grid-template-columns: 1fr 1fr;
  column-gap: 22px;
}

.historyBlock__rightBlock_card_body_smallCard {
  border-bottom: 1px solid rgba(0, 113, 155, 0.3);
  padding-bottom: 22px;
  margin-top: 0;
  margin-bottom: 22px;
}

@media screen and (max-width: 1480px) {
  .historyBlock__rightBlock_card_body {
    grid-template-columns: 1fr;
  }
}

@media screen and (max-width: 1160px) {
  .feedback__body_card--second {
    display: none;
  }
}

